import {useEffect, useState} from 'react'


const Home = () => {
    const [heros, setHeros] = useState([])

    useEffect(() => {
        fetch('https://www.superheroapi.com/api.php/3992681667526682/2/biography')
        .then(response => response.json())
        .then(data => {
            console.log(data)
            setHeros(data)
        })
    }, [])


    return(
        <>
        <h1>heros</h1>
        {
            heros.map(hero => {
                return(
                    <div>
                        <h3> {hero.name} - id: {hero.id}</h3>
                    </div>
                )
            })
        }
        </>
    )
}

export default Home
